import React from 'react'
import Vote from './Vote'
import Results from './Results'


const Pollsdetails = ({polls, setPolls, handleSelectPoll, pollSelected, handleVote}) => {

  const [chartCon, setChartCon] = useState()

  return (
    <div className='container pollsDetails'>
      {pollSelected ? 
        (
          pollSelected.voted === false ? 
          (
            
            <Vote
              polls = {polls}
              setPolls = {setPolls}
              pollSelected={pollSelected}
              handleVote={handleVote}
            />
          ):(
            <Results 
              polls = {polls}
              setPolls = {setPolls}
              pollSelected={pollSelected}
              handleVote={handleVote}
            />
          )
        ):(
          null
        )
      }
    </div>
  )
}

export default Pollsdetails
